Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">military</font></font></font></a><font color="#333333">&nbsp;</font><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">(&quot;TNI&quot;) in April 1999, The organization is now independent and is under the direct auspices of the President of Indonesia, while the Armed Forces is under the&nbsp;</font></font></font><a href="https://en.wikipedia.org/wiki/Ministry_of_Defence_(Indonesia)"><font color="#0782c1"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Ministry of Defense</font></font></font></a><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">. Until this day, the Indonesian National Police is and still holds control of law enforcement and policing duties all over Indonesia nationally.</font></font></font><br />\r\n&nbsp;</p>\r\n\r\n<div style="margin-bottom: 0in; line-height: 100%;"><strong><font color="#2883dd"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 12pt">Vision</font></font></font></strong></div>\r\n\r\n<div style="margin-bottom: 0in; line-height: 100%;">&nbsp;</div>\r\n\r\n<div style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">The realization of the security services and public order are primed,</font></font></font></div>\r\n\r\n<p style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">The rule of law and security in the nation stable and synergy policioned and proactive</font></font></font><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p style="margin-bottom: 0in; line-height: 100%;"><strong><font color="#2883dd"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 12pt">Mission</font></font></font></strong></p